        <div style={{color:"skyblue"}}>
            <h4>get started</h4>
            <form>
                <input type="text" placeholder="Mobile/Email"/>
                <button>Continue</button>
<br/>
or Continue with
<button>Whatasapp</button>&ensp;<button>Google</button>

            </form>
            
        </div>
    )
}
export default OTP1;
